import React, { useState, useEffect } from "react";
import './Review.css';
import data from "./review-tables/data";
import { FaPowerOff } from "react-icons/fa";
import { Button } from 'react-bootstrap-buttons';

function Review() {

    const [testState, setTestState] = useState();
    const onChangeComboBox = (e) => {
      const selectedId = e.target.value;
      const selectedTestState = data.filter((d) => d.id == selectedId)[0];
      setTestState(selectedTestState);
    };

    useEffect(() => {
      setTestState(data[1]);
    }, []);

return (

	<div className="App">
<select
        className="custom-select"
        value={testState?.id}
        onChange={(e) => {
          onChangeComboBox(e);
        }}
      >
        {data.map((d) => (
          <option key={d.id} value={d.id}>
            {d.box}
          </option>
        ))}
      </select>


            <h1>Review Old Application</h1>
            <h2>Logout</h2>
            <h3btn><FaPowerOff/></h3btn>


	<table class="Review">
        <thead>
            <tr>
                <th><Button class="header">S.NO</Button></th>
                <th class="header">Compliance Type</th>
                <th class="header">Application Name</th>
                <th class="header">Date</th>
                <th class="header">Status</th>
                <th class="header">Action</th>
            </tr>
        </thead>



	    <tbody>  
		<tr>
		<td>?</td>
		<td>?</td>
		<td>?</td>
        <td>?</td>
        <td>?</td>
        <td>?</td>
		</tr>

        <tr>
		<td>?</td>
		<td>?</td>
		<td>?</td>
        <td>?</td>
        <td>?</td>
        <td>?</td>
		</tr>

        <tr>
		<td>?</td>
		<td>?</td>
		<td>?</td>
        <td>?</td>
        <td>?</td>
        <td>?</td>
		</tr>

        <tr>
		<td>?</td>
		<td>?</td>
		<td>?</td>
        <td>?</td>
        <td>?</td>
        <td>?</td>
		</tr>

        <tr>
		<td>?</td>
		<td>?</td>
		<td>?</td>
        <td>?</td>
        <td>?</td>
        <td>?</td>
		</tr>

        <tr>
